import React, { useState } from "react";
import { RiMenu3Line, RiCloseLine } from 'react-icons/ri';
import logo from '../../assets/logo.png'
import './navbar.css';
import Aboutus from './../../containers/aboutus/Aboutus';



// bem -> Block Element Modifier

const Navbar = () => {
    const[toggleMenu, setToggleMenu] = useState(false)
    return (
        <div className ="ccs__navbar">
            <div className ="ccs__navbar-links">
        
            <div className="ccs__navbar-links_container" >
                <p><a href="#home" > About </a></p>
                <p><a href="#home" color="white"> Gallery </a> </p>
                
                
            </div>
            </div>
            <div className ="ccs__navbar-links">
        
            <div className="ccs__navbar-links_container2">
                
                <p><a href="#home"> Pricing </a></p>
                <p><a href="#footer"> Contact Us </a></p>
                
            </div>
            </div>
            
        </div>
    )
}
export default Navbar;
